  const part3 = {
    name: 'State of a component',
    exercises: 14
  }

  return(
    <div>
    <Header course = {course}/>
    <Content part1 = {part1.name} part2 = {part2.name} part3 = {part3.name} exercises1 = {exercises1.exercises} exercises2 = {exercises2.exercises} exercises3 = {exercises3.exercises}/>
    <Total course = {course}exercises1 = {exercises1} exercises2 = {exercises2} exercises3 = {exercises3}/>
    </div>
  )
}

export default App;
